import React from "react";
import './AboutMe.css';

function AboutMe() {
    return (
      <div id="about-me">
          <h3>About Me</h3>
        <p>Software engineer with a background in production and technology. Passionate about media and programming, I solve problems using languages such as JavaScript, React, and other front-end modalities. Constantly building my programming skills through work and personal projects, I thrive when developing new softwareâ€™s and working on teams where I am pushed as a developer.</p>
        <div className="about-me-images"><h3>Skills</h3>
          <img src="https://gamesandimpact.org/wp-content/uploads/2014/09/htmlCssJavascriptLogos.png" alt=""></img>
          <img src="https://i.pinimg.com/originals/f3/47/70/f34770503b90f26ea389f557500ff825.png" alt="" />
          <img src="https://cdn2.iconfinder.com/data/icons/line-design-database-set-4/21/sql-badge-512.png" alt="" />
          <img src="https://www.orthanc-server.com/img/Resources/PostgreSQL.png" alt="" />
          <img src="https://images.tutorialedge.net/images/node.png" alt="" />

          <img src="https://www.resourcifi.com/wp-content/themes/resourcifi-child/img/express-min.png" alt="" />
          <img src="https://www.betterwebsites.ca/media/Logo-Ruby.png" alt="" />

          <img src="https://www.arkasoftwares.com/images/android/rubyonrailsLogo.png" alt="" />
          <img src="https://i.pinimg.com/originals/be/94/40/be9440842c51103ad232896b8b0f3706.png" alt="" />

        </div>
      </div>

    );
  }

  export default AboutMe;
